package main

import "fmt"

type Trie struct {
	Finish bool
	Child  []*Trie
}

func findAllConcatenatedWordsInADict(words []string) []string {
	root := Trie{Finish: false, Child: make([]*Trie, 26)}
	for _, w := range words {
		if len(w) == 0 {
			continue
		}
		p := &root
		for _, b := range w {
			if p.Child[int(b-'a')] == nil {
				p.Child[int(b-'a')] = &Trie{Finish: false, Child: make([]*Trie, 26)}
			}
			p = p.Child[int(b-'a')]
		}
		p.Finish = true
	}

	ret := []string{}
	intermedia := map[string]bool{}
	aggr := map[string]int{}
	var dfs func(root *Trie, remain string, idx int, cnt int) bool
	dfs = func(root *Trie, remain string, idx int, cnt int) bool {
		if idx == len(remain) {
			if cnt > 1 {
				aggr[remain] = 1
			}
			return true
		}

		match := false
		p := root
		for i := idx; i < len(remain); i++ {
			c := p.Child[int(remain[i]-'a')]
			if c == nil {
				break
			}

			if c.Finish {
				_, ok := intermedia[remain[i+1:]]
				if !ok {
					r := dfs(root, remain, i+1, cnt+1)
					intermedia[remain[i+1:]] = r
				}

				if intermedia[remain[i+1:]] {
					if i+1 != len(remain) {
						aggr[remain] = 1
					}
					match = true
					break
				}
			}
			p = p.Child[int(remain[i]-'a')]
		}
		intermedia[remain[idx:]] = match

		return match
	}

	for _, w := range words {
		dfs(&root, w, 0, 0)
	}
	for k := range aggr {
		ret = append(ret, k)
	}

	return ret
}
